import React, { useState } from 'react';
import  Link   from 'next/link'
import Router, { useRouter } from 'next/router'
import { useSelector, useDispatch } from 'react-redux';
import {
  Collapse,
  Container,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Button
} from 'reactstrap';

export default function NavBar(props: any) {

  // console.log(props)
  const [isOpen, setIsOpen] = useState(false);
  // const user = useSelector((state: any) => state.auth.user)
  // console.log(user)
  const toggle = () => setIsOpen(!isOpen);



  return (
    <div className='navbar-div'>
      <Navbar dark color='dark' expand='md' container='fluid' fixed='top' id="navbar">
        <NavbarBrand href="/">Iron Vault</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="me-auto" navbar>
            <NavItem>
              <NavLink href="/">Home</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/profile">Profile</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/signup">Sign Up</NavLink>
            </NavItem>
          </Nav>
          <div className='login-logout-link'>
            { props.isLoggedIn ? <a onClick={props.handleLogout}>Logout</a> : <Link href='/login'><a>Login</a></Link> }
          </div>
        </Collapse>

      </Navbar>
    </div>
  );
}
